import React, { Component } from "react";
import { MDBContainer, MDBRow, MDBCol, MDBInput, MDBBtn, MDBIcon, MDBCard, MDBCardBody, MDBModal,  MDBModalBody, MDBModalFooter } from "mdbreact";
import DocsLink from "./../components/docsLink";

class FormsPage extends Component {
  state = {
    modal: false
  }

  toggle = () => {
    this.setState({
      modal: !this.state.modal
    });
  }

  render() {
    return (
      <MDBContainer className="mt-5" style={{marginLeft: "5px",}}>

        <MDBRow>
          <MDBCol md="3" style={{backgroundColor:"red",height:"100"}}>

          </MDBCol>
          <MDBCol md="9" style={{paddingTop: "30px",backgroundColor: "blue",}}>

          </MDBCol>
        </MDBRow>
      </MDBContainer>
    );
  }
}

export default FormsPage;
